    public static class DoEkoContextExtensions
    {
        public static void EnsureSeedData(this DoEkoContext context)
        {
            if (context.AllMigrationsApplied())
            {
                if (!context.Countries.Any())
                {
                    SeedCountries(context);
                }
                if (!context.States.Any())
                {
                    SeedStates(context);
                }
                if (!context.Districts.Any())
                {
                    SeedDistricts(context);
                }
                if (!context.Communes.Any())
                {
                    SeedCommunes(context);
                }
            }
        }

